import './App.css';
import React from 'react';



class NavHeader extends React.Component {
  state = {
    display: "inline-flex",
    width: "100%",
    height: "fit-content",
    color: "white",
    "background-color": "black"
  };

  render() {
    return (
      <nav style={this.state}>
        <h1>Vibe Chat</h1>
        <h2>:</h2>
        <input type='button' onClick={() => {
          this.setState({
            display: "inline-flex",
            width: "100%",
            height: "fit-content",
            color: "white",
            "background-color": "blue"
          })
        }} value="Press" />
      </nav>
    );
  }
}


function App() {
  return (
    <NavHeader />
  );
}

export default App;
